Brasileiros, abram os olhos:

1- combate ao crime X liberação de presos;
2- liberdade X censura;
3- combate ao tráfico X liberação de drogas;
4- família X Ideologia de gênero;
5- defesa da vida X aborto;
6- imprensa livre X regulação da mídia;
7- zero corrupção X corrupção total…

No mais, só desenhando!!! Dia 30 é 2️⃣2️⃣!!!!
